import React from 'react';
import Link from 'next/link';
import { Button } from 'antd';
import { useSelector } from 'react-redux';

const Profile = () => {
    const { me } = useSelector(state => state.user);

    
    return (
    <>
        <div>프로필</div>
        <Link href="/"><Button>홈</Button></Link>
        <Button>로그아웃</Button>
    </>
        )
}

export default Profile ;
